commits.content:
.navbar {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 10px 20px;
    background-color: #333;
    color: white;
}

/* Desktop Links */
.desktop-links {
    display: flex;
}

.desktop-links ul {
    display: flex;
    list-style: none;
    padding: 0;
    margin: 0;
}

.desktop-links li {
    margin: 0 15px;
    cursor: pointer;
}

.mobile-navbar {
    display: none;
}

/* Media Query for Mobile */
@media (max-width: 768px) {
    .desktop-links {
        display: none;
    }

    .mobile-navbar {
        display: block;
    }

    .mobile-navbar ul {
        list-style: none;
        margin: 0;
        padding: 10px 0;
        background-color: #333;
        position: absolute;
        top: 50px;
        left: 0;
        width: 100%;
    }

    .mobile-navbar li {
        padding: 10px;
        border-bottom: 1px solid #444;
    }
}
